// Generated by BUCKLESCRIPT, PLEASE EDIT WITH CARE
'use strict';

var Json_decode = require("@glennsl/bs-json/src/Json_decode.bs.js");

function name(t) {
  return t.name;
}

function email(t) {
  return t.email;
}

function id(t) {
  return t.id;
}

function avatarUrl(t) {
  return t.avatarUrl;
}

function title(t) {
  return t.title;
}

function decode(json) {
  return {
          id: Json_decode.field("id", Json_decode.string, json),
          name: Json_decode.field("name", Json_decode.string, json),
          email: Json_decode.field("email", Json_decode.string, json),
          avatarUrl: Json_decode.optional((function (param) {
                  return Json_decode.field("avatarUrl", Json_decode.string, param);
                }), json),
          title: Json_decode.field("title", Json_decode.string, json)
        };
}

exports.name = name;
exports.email = email;
exports.id = id;
exports.avatarUrl = avatarUrl;
exports.title = title;
exports.decode = decode;
/* No side effect */
